import TextField from '@mui/material/TextField';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import BasicSelect from '../../components/IdeaComponents/Select';
import { makeStyles } from "@material-ui/core";

const useStyles = makeStyles((theme) => ({
    Form: {
        flex: 1,
        backgroundColor: theme.palette.background.paper,
    },
    Name: {
        padding: 24,
        paddingTop: 0,
        display: "flex",
        gap: 20,
    },
    Description: {
        padding: 24,
        paddingTop: 0,
        display: "flex",
        gap: 20,
    },
    Select: {
        padding: 24,
        paddingTop: 0,
        display: "flex",
        gap: 20,
    },
    Btn: {
        padding: 24,
        paddingTop: 0,
        display: "flex",
        gap: 20,
    }
}));

const AddIdea = () => {
    const classes = useStyles();

    return (
        <Box component = 'form' className={classes.Form}>
            <div className={classes.Name}>
                <TextField id="ideaName" label="Name of Idea" variant="standard" fullWidth/>
            </div>
            <div className={classes.Description}>
                <TextField id="ideaDescription" label="Description" variant="standard" fullWidth />
            </div>
            <div className={classes.Select}>
                <BasicSelect />
            </div>
            <div className={classes.Btn}>
            <Button
                variant="contained"
                style={{
                width: 85,
                height: 40,
                marginLeft: 15,
                color: "black",
                backgroundColor: "#EEBC1D",
                }}
            >
                Add
            </Button>
            </div>
        </Box>
    )
}

export default AddIdea
